const BlogDetails = ({ blog }) => {
  return (
    <div className="blog-details">
      <h4>{blog.title}</h4>
      <p>
        <strong>{blog.body}</strong>
      </p>
      <span>{blog.author}</span>
    </div>
  );
};

export default BlogDetails;
